    def mainProg(self):
        if self.filename == '':
            msg = QMessageBox()
            msg.setWindowTitle("Information")
            msg.setText("Please select the image file to begin the process!")
            msg.setIcon(QMessageBox.Question)
            msg.setStandardButtons(QMessageBox.Ok | QMessageBox.Cancel)
            msg.setDefaultButton(QMessageBox.Ok)
            msg.buttonClicked.connect(self.MessageCommand)
            x = msg.exec_()
            return
        else:
            
            picture=cv2.imread(self.filename)
            grayImage=cv2.cvtColor(picture, cv2.COLOR_BGR2GRAY)
            face_cascade=cv2.CascadeClassifier("haarcascade_frontalface_default.xml")
            faces=face_cascade.detectMultiScale(grayImage,
            scaleFactor=1.1,
            minNeighbors=10)
            flag=0
            for x,y,w,h in faces:
                if w>400:
                    flag=1
                    img=cv2.rectangle(picture, (x,y), (x+w, y+h), (0,255,1), 3)
            if flag == 1:
                cv2.imwrite("p01.jpg", img)
                self.image.setPixmap(QtGui.QPixmap("p01.jpg"))
                self.image.setScaledContents(True)
            
            else:
                self.image.setText("   Nothing detected.")
    
    def MessageCommand(self,  i):
        if "Ok" in i.text():
            pass
        else:
            self.window.close()
    def fileLocator(self):
        self.filename = QFileDialog.getOpenFileName(MainWindow, "Open File", "C:\\Users", "All Files (*);;PNG Files (*.png);;Jpg Files (*.jpg)")
        self.filename = self.filename[0]
    
    def reset_all(self):
        self.filename =''
        self.image.setText("   ")

